import React, { Fragment } from 'react';
import Appass from './apppass';

const dummyTodos = [
    {
      id: 1,
      title: 'props',
      desc: 'I am from props'
    },
    {
        id: 2,
        title: 'Todo',
        desc: 'I am from todo'
      },
      {
        id: 2,
        title: 'Todo',
        desc: 'I am from todo'
      }
];

const AppHome = () => {
       return (
           <Fragment>
              <div>
              <Appass TodoPass={dummyTodos}/>
              </div>
           </Fragment>
       );
   };
   export default AppHome;
